import React from 'react';
import OrderForm from '../Forms/OrderForm';

class OrderPage extends React.Component {
    render() {
        return (
            <div className="order-form-container">
                <div className="order-form-header">
                    Заказать
                </div>
                <OrderForm />
            </div>
        )
    }
}

export default OrderPage;
